import React, { useState } from "react";
import axios from "axios";
import { useParams } from "react-router-dom";
import { useDispatch } from "react-redux";
import { useNavigate } from "react-router-dom";
import { setToken, setUserType } from "../../../redux/Reducer/AuthReducer";

const AddDoctor = () => {
  const { id } = useParams(); // Get the ID from URL parameters
  const [formData, setFormData] = useState({
    firstName: "",
    lastName: "",
    email: "",
    phone: "",
    password: "",
    confirmPassword: "",
    Departments: "",
    Gender: "",
    bio: "",
    instagram: "",
    facebook: "",
    linkedIn: "",
    twitter: "",
  });

  const [experienceFields, setExperienceFields] = useState([""]); // Array to manage multiple experience inputs
  const [message, setMessage] = useState(""); // State for messages
  const [messageType, setMessageType] = useState(""); // State for message type ('success' or 'error')
  const [loading, setLoading] = useState(false); // State for loader and button disable

  const dispatch = useDispatch();
  const navigate = useNavigate();

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevState) => ({
      ...prevState,
      [name]: value,
    }));
  };

  // Handle experience field change
  const handleExperienceChange = (index, value) => {
    const updatedExperience = [...experienceFields];
    updatedExperience[index] = value;
    setExperienceFields(updatedExperience);
  };

  // Add new experience input field
  const addExperienceField = () => {
    setExperienceFields([...experienceFields, ""]);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true); // Start loading and disable the button
    try {
      const response = await axios.post(
        `http://localhost:8080/doctor/doctor-register/${id}`,
        { ...formData, experiences: experienceFields } // Send experience fields along with formData
      );
      setMessage("Doctor added successfully!"); // Set success message
      setMessageType("success"); // Set message type to success
      dispatch(setUserType(response.data.userType));
      navigate("/dashboard");
    } catch (error) {
      setMessage("There was an error registering the doctor."); // Set error message
      setMessageType("error"); // Set message type to error
    } finally {
      setLoading(false); // Stop loading and enable the button again
    }
  };

  return (
    <div className="min-h-screen bg-gray-50 p-4 mb-16">
      <div className="mx-5 flex justify-between">
        <h3 className="py-2 font-bold text-gray-700 text-lg">
          Complete Your Profile
        </h3>
      </div>
      <div className="flex justify-center">
        <div className="bg-white shadow-md rounded-lg p-6 w-full max-w-4xl">
          <form onSubmit={handleSubmit}>
            {/* Existing form fields */}
            <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
              <div>
                <label className="block text-gray-600">First Name</label>
                <input
                  type="text"
                  name="firstName"
                  value={formData.firstName}
                  onChange={handleChange}
                  placeholder="First Name"
                  className="w-full mt-2 p-2 border rounded"
                />
              </div>
              <div>
                <label className="block text-gray-600">Last Name</label>
                <input
                  type="text"
                  name="lastName"
                  value={formData.lastName}
                  onChange={handleChange}
                  placeholder="Last Name"
                  className="w-full mt-2 p-2 border rounded"
                />
              </div>
              {/* Add other input fields */}
              {/* Experience Section */}
              <div className="col-span-2">
                <label className="block text-gray-600">Experience</label>
                {experienceFields.map((experience, index) => (
                  <div key={index} className="flex items-center mt-2">
                    <input
                      type="text"
                      name={`experience_${index}`}
                      value={experience}
                      onChange={(e) =>
                        handleExperienceChange(index, e.target.value)
                      }
                      placeholder="Experience"
                      className="w-full p-2 border rounded"
                    />
                    {index === experienceFields.length - 1 && (
                      <button
                        type="button"
                        onClick={addExperienceField}
                        className="bg-blue-500 text-white py-2 px-4 ml-2 rounded hover:bg-blue-600"
                      >
                        +
                      </button>
                    )}
                  </div>
                ))}
              </div>
            </div>
            {/* Submit button */}
            <button
              type="submit"
              className={`bg-blue-500 text-white py-2 px-4 rounded mt-4 flex items-center justify-center ${
                loading ? "opacity-50 cursor-not-allowed" : "hover:bg-blue-600"
              }`}
              disabled={loading} // Disable the button when loading
            >
              {loading ? (
                <div className="loader">Loading...</div> // Show loader
              ) : (
                "Add Doctor" // Show button text
              )}
            </button>
            {/* Display message */}
            {message && (
              <div
                className={`mt-2 ${
                  messageType === "success" ? "text-green-500" : "text-red-500"
                }`}
              >
                {message}
              </div>
            )}
          </form>
        </div>
      </div>
    </div>
  );
};

export default AddDoctor;
